      "priority": "High",
      "param_matrix": [
        {
          "func": "lambda x: x * 2",
          "structure": {"a": 1, "b": 2},
          "expected": {"a": 2, "b": 4},
          "description": "字典乘以2"
        },
        {
          "func": "lambda x: x + 1",
          "structure": [1, [2, 3]],
          "expected": [2, [3, 4]],
          "description": "嵌套列表加1"
        },
        {
          "func": "str",
