          "struct1": {"x": 1, "y": 2},
          "struct2": {"x": 3, "y": 4},
          "should_pass": true,
          "check_types": true,
          "description": "相同字典结构"
        },
        {
          "struct1": [1, [2, 3]],
          "struct2": [4, [5, 6]],
