        {
          "structure": [0, 0],
          "flat_sequence": [1, 2],
          "expected": [1, 2],
          "description": "简单列表重建"
        },
        {
          "structure": {"a": 0, "b": 0},
          "flat_sequence": [3, 4],
          "expected": {"a": 3, "b": 4},
          "description": "字典重建"
        },
        {
          "structure": [1, [2, 3]],
          "flat_sequence": [10, 20, 30],
          "expected": [10, [20, 30]],
          "description": "嵌套结构重建"
        }
      ],
      "asserts": {
        "weak": ["structure_match", "element_order", "basic_property"],
        "strong": ["exact_reconstruction", "edge_cases", "error_handling"]
      },
