        {
          "structure": [1, 2, 3],
          "expected": true,
          "description": "列表是嵌套结构"
        },
        {
          "structure": {"a": 1},
          "expected": true,
          "description": "字典是嵌套结构"
        },
        {
          "structure": 42,
          "expected": false,
          "description": "整数不是嵌套结构"
        },
        {
          "structure": "string",
          "expected": false,
          "description": "字符串不是嵌套结构"
        }
      ],
